I wanna tell baby Peanut that the voice lessons will be worth it. That studying vocal performance at @baltschoolarts would be the greatest decision of her life. That she can dance AND sing AND act, and not have to choose one over the other. That she will get to be in rooms creating art with people she idolizes. That she will never not love to perform. And that one day, people will believe in her enough to cast her in a Sondheim show on Broadway. 

I think she would be pretty jazzed to hear about that. 

@sweeneytoddbway Day 1. ❤️
